    public static void main(String[] args) {
        new TestRijndael().commandline(args);
    }

    protected void engineTest() throws Exception {
        setExpectedPasses(1922);

        out.println("*** Algorithm available as Rijndael");
        alg = Cipher.getInstance("Rijndael", "Cryptix");
        passIf(true, "Algorithm available as Rijndael");

        out.println("*** Algorithm available as AES");
        alg = Cipher.getInstance("AES", "Cryptix");
        passIf(true, "Algorithm available as AES");

        out.println("*** Known answer tests");
        testKnown();
    }

    private void testKnown() throws Exception {
        byte[] ect, dct;
        String a, b;

        for (int i = 0; i < TEST_VALUES.length; i++) {
            RawSecretKey key = new
                RawSecretKey("Rijndael", Hex.fromString(TEST_VALUES[i][0]));
        
            alg.initEncrypt(key);
            ect = alg.crypt(Hex.fromString(TEST_VALUES[i][1]));
            a = Hex.toString(ect);
            alg.initDecrypt(key);
            dct = alg.crypt(ect);
            b = Hex.toString(dct);
            
            out.print("  plain: " + TEST_VALUES[i][1] +
                ", cipher: " + a + ", cert: " + TEST_VALUES[i][2]);

            passIf(a.equals(TEST_VALUES[i][2]), "Test #1/Enc " + (i+1));
        
            out.print(" cipher: " + Hex.toString(ect) +
                ",  plain: " + b + ", cert: " + TEST_VALUES[i][1]);

            passIf(b.equals(TEST_VALUES[i][1]), "Test #1/Dec " + (i+1));
        }
    }
    
